Text:
Hmmm en person som skriver att han vill ha de två andra säsongerna... aja, det räcker för mig, nästa kommer troligtvis upp imorrn :) och den tredje KANSKE kan komma upp samma dag. Vill gärna få ut minst en full kopia innan jag börjar på en ny, annars går det så segt :)

Det får vi skylla på Telia... och ni som gillar Telia kan skylla på Microsoft :)

//Adde
